import React, { useState, useEffect, useParams } from "react";
import { Link } from "react-router-dom";
import ClienteService from "../../services/ClienteService"

const ListaClientes = () => {
    const [cliente, setCliente] = useState([]);

    const [name, setName] = useState('')
    const [rua, setRua] = useState('')
    const [numero, setNumero] = useState('')
    const [bairro, setBairro] = useState('')
    const [cidade, setCidade] = useState('')
    const [estado, setEstado] = useState('')
    const [cep, setCep] = useState('')
    const [cnpj, setCnpj] = useState('')
    const history = useNavigate();
    const { id } = useParams();

    useEffect(() => {
        getAllClientes();
    }, []);

    const getAllClientes = () => {
        ClienteService.getAllClientes()
            .then((response) => {
                setCliente(response.data);
                console.log(response.data);
            })
            .catch((error) => {
                console.log(error);
            });
    };

    const deleteCliente = (clienteId) => {
        ClienteService.deleteCliente(clienteId).then((response) => {
            getAllClientes();
        }).catch(error => {
            console.log(error);
        })
    }

    useEffect(() => {

        ClienteService.getClienteById(id).then((response) => {
            setName(response.data.name)
            setRua(response.data.rua)
            setNumero(response.data.numero)
            setBairro(response.data.bairro)
            setCidade(response.data.cidade)
            setEstado(response.data.estado)
            setCep(response.data.cep)
            setCnpj(response.data.cnpj)
        }).catch(error => {
            console.log(error)
        })
    }, [])

    const verificaCliente = () => {

        if ( 1 < 1) {
            <Link className="btn" to={`/edit-cliente-pf/${cliente.id}`} >Atualizar p</Link>

        }else{
            <Link className="btn" to={`/edit-cliente-pj/${cliente.id}`} >Atualizar e</Link>

        }


    };

    return (
        <div className="container-livro">
            <h1> Clientes </h1>
            <Link to="/add-cliente" className="btn mb-4 btn-lg">
                {" "}
                Novo Cliente{" "}
            </Link>
            <table className="table table-bordered table-striped">
                <thead>
                    <tr>
                        <th> <p>Id</p> </th>
                        <th> <p>Nome</p> </th>
                        <th> <p>Rua</p> </th>
                        <th> <p>Numero</p> </th>
                        <th> <p>Bairro</p> </th>
                        <th> <p>Cidade</p> </th>
                        <th> <p>Estado</p> </th>
                        <th> <p>Cep</p> </th>
                        <th> <p>Ações</p> </th>
                    </tr>
                </thead>
                <tbody>
                    {cliente.map((cliente) => (
                        <tr key={cliente.id}>
                            <td> <p className="p_td">{cliente.id}</p></td>
                            <td> <p className="p_td">{cliente.name}</p> </td>
                            <td> <p className="p_td">{cliente.rua}</p> </td>
                            <td> <p className="p_td">{cliente.numero} </p> </td>
                            <td> <p className="p_td">{cliente.bairro} </p> </td>
                            <td> <p className="p_td">{cliente.cidade} </p> </td>
                            <td> <p className="p_td">{cliente.estado} </p> </td>
                            <td> <p className="p_td">{cliente.cep} </p> </td>
                            <td>
                                <div className="div-acoes">

                                    {
                                        verificaCliente()
                                    }




                                    <button className="btn" onClick={() => deleteCliente(cliente.id)}
                                    >Deletar</button>
                                </div>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ListaClientes;
